# See details here https://wenshengchen.com/2019/09/03/28-implement-str-str.html
class Solution:
    def strStr(self, haystack: str, needle: str) -> int:
        if len(needle) == 0 or haystack == needle:
            return 0
        if len(haystack) < len(needle):
            return -1

        charMask = [False] * 128
        count = len(needle)
        start, end = 0, 0

        for char in needle:
            charMask[ord(char)] = True

        while end < len(haystack):
            if charMask[ord(haystack[end])]:
                count -= 1
            end += 1

            while count == 0:
                while end - start > len(needle) or count == 0 and haystack[start:start+len(needle)] != needle:
                    if charMask[ord(haystack[start])]:
                        count += 1
                    start += 1

                if count == 0:
                    return start

        return -1

## TEST CASES
test = Solution()
answer = test.strStr("hello", "ll")
assert answer == 2,answer
answer = test.strStr("", "a")
assert answer == -1,answer
answer = test.strStr("aaaaa", "bba")
assert answer == -1,answer
answer = test.strStr("abcde", "")
assert answer == 0,answer
answer = test.strStr("aaaaa", "aa")
assert answer == 0,answer
answer = test.strStr("aaa", "aaaaa")
assert answer == -1,answer
answer = test.strStr("mississippi", "issipi")
assert answer == -1,answer
answer = test.strStr("mississippi", "pi")
assert answer == 9,answer
answer = test.strStr("aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaab", "aaaab")
assert answer == 40,answer
answer = test.strStr("", "")
assert answer == -1,answer
print('All Passed!')
